import React from "react";
import { Link } from "react-router-dom";

function Logout(props) {
  return (
    <Link to="/" onClick={props.onLogout} style={{ textDecoration: "none" }}>
      <div className="text-center "> Logout</div>
    </Link>
  );
}

export default Logout;
